import React from "react";
import styled from "styled-components";

const Wrapper = styled.div`
  font-family: "Pacifico", sans-serif;
  height: 100vh;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  color: white;
  background-image: url(" https://cityfurnish.com/blog/wp-content/uploads/2023/08/healthy-positive-happy-woman-holding-paper-shopping-bag-full-fruit-vegetables-min-1200x806.jpg"); /* Replace with your image */
  background-size: cover;
  opacity: 70%;
`;

const Title = styled.h1`
  font-size: 3rem;
  margin-bottom: 20px;
  color: black;
`;

const Description = styled.p`
  font-size: 1.5rem;
  text-align: center;
  color: black;
`;
const ServicesSection = styled.section`
  display: flex;
  justify-content: center;
  gap: 40px;
  margin-top: 40px;
`;

const ServiceBox = styled.div`
  background-color: black;
  font-family: Fantasy;
  padding: 20px;
  border-radius: 10px;
  text-align: center;
  width: 200px;
`;

const ServiceTitle = styled.h2`
  font-size: 1.5rem;
  margin-bottom: 10px;
`;

const ServiceDescription = styled.p`
  font-size: 1rem;
`;
const TopCategoriesSection = styled.section`
  display: flex;
  justify-content: center;
  gap: 20px;
  margin-top: 40px;
`;

const CategoryBox = styled.div`
  background-color: grey;
  padding: 20px;
  oopacity: 60%;
  border-radius: 10px;
  text-align: center;
  width: 200px;
`;

const CategoryTitle = styled.h3`
  font-size: 1.2rem;
  margin-bottom: 10px;
  font-family: Monospace;
`;

const CategoryImage = styled.img`
  width: 100px;
  height: 100px;
  object-fit: cover;
  border-radius: 50%;
  margin-bottom: 10px;
`;
const HomePage = () => {
  return (
    <Wrapper>
      <Title>There U Grocs:Your Go-To Grocer</Title>
      <Description>Find the freshest products and best deals here!</Description>
      <ServicesSection>
        <ServiceBox>
          <ServiceTitle>Fresh Products</ServiceTitle>
          <ServiceDescription>
            Wide variety of fruits and vegetables
          </ServiceDescription>
        </ServiceBox>

        <ServiceBox>
          <ServiceTitle>Quality Products</ServiceTitle>
          <ServiceDescription>
            Best quality meat and dairy items
          </ServiceDescription>
        </ServiceBox>

        <ServiceBox>
          <ServiceTitle>Fast Delivery</ServiceTitle>
          <ServiceDescription>
            Reliable and swift delivery service
          </ServiceDescription>
        </ServiceBox>

        <ServiceBox>
          <ServiceTitle>Great Deals</ServiceTitle>
          <ServiceDescription>Exciting discounts and offers</ServiceDescription>
        </ServiceBox>
      </ServicesSection>
      <TopCategoriesSection>
        <CategoryBox>
          <CategoryImage
            src="data:image/jpeg;base64,"
            alt="Category 1"
          />
          <CategoryTitle>Fruits</CategoryTitle>
        </CategoryBox>

        <CategoryBox>
          <CategoryImage
            src="https://domf5oio6qrcr.cloudfront.net/medialibrary/10200/GettyImages-1208790371.jpg"
            alt="Category 2"
          />
          <CategoryTitle>Vegetables</CategoryTitle>
        </CategoryBox>

        <CategoryBox>
          <CategoryImage
            src="data:image/jpeg;base64,"
            alt="Category 3"
          />
          <CategoryTitle>Meat</CategoryTitle>
        </CategoryBox>

        <CategoryBox>
          <CategoryImage
            src="https://www.shutterstock.com/image-photo/various-dairy-products-600nw-627224804.jpg"
            alt="Category 4"
          />
          <CategoryTitle>Dairy</CategoryTitle>
        </CategoryBox>
      </TopCategoriesSection>
    </Wrapper>
  );
};

export default HomePage;
